import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="text-center mt-10">
      <h1 className="text-3xl font-bold">Welcome to AI Travel Planner</h1>
      <p className="mt-4">Plan your trip effortlessly with AI.</p>
      <Link to="/itinerary" className="mt-6 px-4 py-2 bg-blue-600 text-white rounded">Get Started</Link>
    </div>
  );
};

export default Home;
